import React from 'react';
// import logo from './logo.svg';
import './App.css';
import Hell from './Hell.js'


class ShoppingList extends 
React.Component {
  render(){
    return (
      <div className="shopping-list">
        <h1>Shopping List for
{this.props.name}</h1>
        <ul>
          <li>Instargram</li>
        </ul>
        </div>
    )
  }
}
export default ShoppingList;



